import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p id="b"></p>
        <input id="a"></input>
        <button  onclick="display()">Add Info</button>
      </header>
    </div>

  );
}

function display(){

  //Assigning the variable to the user input
    var userName = document.getElementById("a").value;

  // to print the input here
  document.getElementById("b").innerHTML = userName;
  }

export default App;
